INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (10.85, 100, "2024/03/31 12:00:00", 100, 129901, 1, "2030/12/17 14:59:59", "エリコ", 10142, 24, 7, 0.0, 0.0, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (11.15, 101, "2024/03/31 12:00:00", 101, 129901, 1, "2030/12/17 14:59:59", "エリコ", 10142, 24, 2, 0.0, 0.0, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (6.4, 102, "2024/03/31 12:00:00", 102, 129901, 7, "2030/12/17 14:59:59", "エリコ", 10142, 24, 5, 0.0, 0.0, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (0.0, 103, "2024/03/31 12:00:00", 103, 129901, 3, "2030/12/17 14:59:59", "エリコ", 10142, 24, 3, 0.0, 0.0, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (2.43, 104, "2024/03/31 12:00:00", 104, 129901, 2, "2030/12/17 14:59:59", "エリコ", 10142, 24, 8, 0.0, 0.0, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (9.08, 105, "2024/03/31 12:00:00", 105, 129901, 4, "2030/12/17 14:59:59", "エリコ", 10142, 24, 3, 0.0, 0.0, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (0.0, 106, "2024/03/31 12:00:00", 106, 129901, 6, "2030/12/17 14:59:59", "エリコ", 10142, 24, 6, 0.0, 0.0, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (10.6, 107, "2024/03/31 12:00:00", 107, 129901, 3, "2030/12/17 14:59:59", "エリコ", 10142, 24, 8, 0.0, 0.0, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (7.54, 108, "2024/03/31 12:00:00", 108, 129901, 6, "2030/12/17 14:59:59", "エリコ", 10142, 24, 4, 0.0, 0.0, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (11.5, 109, "2024/03/31 12:00:00", 109, 129901, 2, "2030/12/17 14:59:59", "エリコ", 10142, 24, 7, 0.0, 0.0, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (8.83, 110, "2024/03/31 12:00:00", 110, 129901, 2, "2030/12/17 14:59:59", "エリコ", 10142, 24, 1, 0.0, 0.0, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (6.68, 111, "2024/03/31 12:00:00", 111, 129901, 1, "2030/12/17 14:59:59", "エリコ", 10142, 24, 2, 0.0, 0.0, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (8.8, 112, "2024/03/31 12:00:00", 112, 129901, 6, "2030/12/17 14:59:59", "エリコ", 10142, 24, 2, 0.0, 0.0, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (8.9, 113, "2024/03/31 12:00:00", 113, 129901, 2, "2030/12/17 14:59:59", "エリコ", 10142, 24, 1, 0.0, 0.0, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (3.7, 114, "2024/03/31 12:00:00", 114, 129901, 2, "2030/12/17 14:59:59", "エリコ", 10142, 24, 5, 0.0, 0.0, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (7.6, 200, "2024/03/31 12:00:00", 200, 129801, 1, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (2.25, 201, "2024/03/31 12:00:00", 201, 129801, 2, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (3.28, 202, "2024/03/31 12:00:00", 202, 129801, 2, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (2.98, 203, "2024/03/31 12:00:00", 203, 129801, 4, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (3.0, 204, "2024/03/31 12:00:00", 204, 129801, 4, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (10.3, 205, "2024/03/31 12:00:00", 205, 129801, 1, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (2.93, 206, "2024/03/31 12:00:00", 206, 129801, 6, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (9.3, 207, "2024/03/31 12:00:00", 207, 129801, 3, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (6.9, 208, "2024/03/31 12:00:00", 208, 129801, 4, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (0.0, 209, "2024/03/31 12:00:00", 209, 129801, 2, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (5.95, 210, "2024/03/31 12:00:00", 210, 129801, 1, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (6.73, 211, "2024/03/31 12:00:00", 211, 129801, 2, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (0.0, 212, "2024/03/31 12:00:00", 212, 129801, 2, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (6.65, 213, "2024/03/31 12:00:00", 213, 129801, 1, "2030/12/17 14:59:59", "マコト", 10142, 24, 2, 0.0, 0.0, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES (3.05, 214, "2024/03/31 12:00:00", 214, 129801, 6, "2030/12/17 14:59:59", "マコト", 10142, 24, 1, 0.0, 0.0, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！");
